export default class Hooks {
  static BASE_URL = "https://beta.reactjs.org/reference/react/";

  static listData = [];

  static createNewList = (val) => {
    val.forEach((item) => {
      this.listData.push({
        btnContent: item + "()",
        href: this.BASE_URL + item,
      });
    });
  };
}
